class InternalDoc extends APIFactory
{
    /**
         * Cleanup memory and session file.
         *
         * @return void
         */
    public function cleanup(array $extra = [])
    {
        return $this->__call(__FUNCTION__, [$extra]);
    }
    /**
     * Logger.
     *
     * @param string $param Parameter
     * @param int    $level Logging level
     * @param string $file  File where the message originated
     *
     * @return void
     */
    public function logger($param, int $level = \danog\MadelineProto\Logger::NOTICE, string $file = '', array $extra = [])
    {
        return $this->__call(__FUNCTION__, [$param, $level, $file, $extra]);
    }
    /**
     * Get TL namespaces.
     *
     * @return array
     */
    public function getMethodNamespaces(array $extra = []): array
    {
        return $this->__call(__FUNCTION__, [$extra]);
    }
    /**
     * Get namespaced methods (method => namespace).
     *
     * @return array
     */
    public function getMethodsNamespaced(array $extra = []): array
    {
        return $this->__call(__FUNCTION__, [$extra]);
    }
    /**
     * Get TL serializer.
     *
     * @return TL
     */
    public function getTL(array $extra = []): danog\MadelineProto\TL\TL
    {
        return $this->__call(__FUNCTION__, [$extra]);
    }
    /**
     * Get logger.
     *
